  Questions Fr\u00e9quentes\\n+D\u00e9tails Produit\\n+Twizy et le Permis\\n+L''acc\u00e8s
  aux Routes et Circulation\\n+Le Stationnement\\n-La Batterie\\n\u2022 Pourquoi la
  batterie est-elle en location ?\\nRenault est en effet propri\u00e9taire de la batterie,
  via sa filiale RCI Banque et la loue \u00e0 ses clients.\\nCela nous permet de vous
  proposer Twizy \u00e0 un prix de vente comp\u00e9titif, sans vous faire supporter
  le co\u00fbt de la batterie lithium-ion (plusieurs milliers d\u2019euros \u00e0
  l\u2019achat). Cela nous permet de vous garantir sur toute la dur\u00e9e de vie
  du v\u00e9hicule, une batterie toujours fonctionnelle (c''est-\u00e0-dire avec une
  capacit\u00e9 de chargement toujours sup\u00e9rieure \u00e0 75% de sa capacit\u00e9
  maximale) . Et enfin, nous vous garantissons de la changer sans surco\u00fbt en
  cas de d\u00e9faillance. Par ailleurs, le recyclage int\u00e9gral des batteries
  en fin de vie sera assur\u00e9 par Renault.\\n(Pour plus de d\u00e9tails, voir les
  conditions g\u00e9n\u00e9rales de location de la batterie dans le r\u00e9seau Renault).\\n\u2022
  Que couvre le loyer de la batterie ?\\nLe loyer de batterie, \u00e0 partir de 50
  \u20ac TTC, inclut deux prestations essentielles. La premi\u00e8re est la mise \u00e0
  disposition d\u2019une batterie toujours fonctionnelle (c''est-\u00e0-dire avec
  une capacit\u00e9 de chargement toujours sup\u00e9rieure \u00e0 75% de sa capacit\u00e9
  maximale) sur toute la dur\u00e9e du contrat souscrit.\\nLe loyer de batterie int\u00e8gre
  \u00e9galement l\u2019assistance \u00ab toutes pannes \u00bb incluant les pannes
  d\u2019\u00e9nergie. Par exemple, si vous tombez en panne d\u2019\u00e9nergie, vous
  serez remorqu\u00e9 gratuitement vers la prise \u00e9lectrique de votre choix dans
  un rayon de 80km.\\n(Pour plus d\u00e9tails, voir les conditions g\u00e9n\u00e9rales
  de location de la batterie dans le r\u00e9seau Renault)\\n\u2022 En cas de revente
  anticip\u00e9e, doit on payer le contrat de location jusqu\u2019\u00e0 la fin de
  la p\u00e9riode d\u2019engagement ?\\nNon, il y a une indemnit\u00e9 de rupture
  anticip\u00e9e de contrat qui sera \u00e0 r\u00e9gler mais le contrat de location
  est transf\u00e9r\u00e9 \u00e0 l\u2019acqu\u00e9reur du v\u00e9hicule.\\n-La Charge\\n\u2022
  Puis-je recharger Twizy sur n\u2019importe quelle prise ?\\nTwizy se recharge sur
  n\u2019importe quelle prise 220V domestique classique. Il n\u2019est pas n\u00e9cessaire
  d\u2019avoir une installation sp\u00e9cifique pour recharger Twizy. Il suffit de
  le brancher dans un garage ou un parking, au travail ou sur les places r\u00e9serv\u00e9es
  en ville\u2026bref partout o\u00f9 il y a une prise de courant.\\n\u2022 En combien
  de temps Twizy se recharge t \u2013il ?\\nTwizy se charge compl\u00e8tement en 3h30
  (si vous \u00eatiez \u00e0 0% de charge) sur une prise domestique classique et sur
  les bornes de recharge publiques : 3h30 et vous voil\u00e0 reparti pour environ
  80km* \u00e0 travers la ville !\\nSes batteries ne souffrant pas d\u2019effet m\u00e9moire,
  il peut \u00eatre recharg\u00e9 \u00e0 tout moment, quel que soit le niveau de charge
  de la batterie. Si vous avez une prise sous la main, rechargez alors Twizy m\u00eame
  quelques minutes et vous augmenterez ainsi encore votre autonomie !\\n*Voir les
  questions \u00ab AUTONOMIE \u00bb pour plus de d\u00e9tails sur ce sujet\\n\u2022
  Combien co\u00fbte un \u00ab plein d\u2019\u00e9lectricit\u00e9 \u00bb avec Twizy
  ?\\nEn moyenne, un plein d \u2018\u00e9lectricit\u00e9 pour Twizy co\u00fbte moins
  d\u20191\u20ac* sur votre facture d\u2019\u00e9lectricit\u00e9. Ce prix pour une
  charge \u00e0 domicile, ne tient pas compte des frais \u00e9ventuels de stationnement,
  ou d\u2019abonnement aupr\u00e8s d\u2019un service de charge publique.\\nPar exemple
  \u00e0 Paris, il est possible de souscrire \u00e0 un abonnement aupr\u00e8s d\u2019Autolib\u2019,
  pour se garer sur les places v\u00e9hicules tiers et recharger son Twizy.\\n*La
  batterie permet de stocker 6,2 kWh. Pour conna\u00eetre le prix exact du \u00abplein
  \u00bb de votre Twizy chez vous, vous devez multiplier le cout du kWh inscrit sur
  votre facture par 6,2.\\n-\\n6,2 kWh pour une recharge, c''est moins que les 8,4
  de l''Outlander mais pas si loin ... ils la mettent o\u00f9 la batterie ? Sous les
