  le farfelu Anglais (mais on comprend tr\u00e8s bien les effets comiques :2funny:
  ) transporte m\u00eame une plante.\\nLiving With A Renault Twizy: What It''s REALLY
  Like\\nhttps://www.youtube.com/watch?v=Xz2z1LXbxzE (https://www.youtube.com/watch?v=Xz2z1LXbxzE)\\nApr\u00e8s
  il y a les voyageurs de l''extr\u00eame... :crazy:\\n-\\nLe retour d''exp\u00e9rience
  int\u00e9ressant d''un Twiziste guadeloup\u00e9en\\nLa TWIZY 80 en Gwada\\nhttp://www.h2osmose.com/twizy/
  (http://www.h2osmose.com/twizy/)\\nCe v\u00e9hicule est n\u00e9 en 2012 ...Le TWIZY
  c''est une solution pour la saturation de nos routes et pour la consommation \u00e9nerg\u00e9tique.\\n...les
  nouveaux groupes diesel de Jarry consommeront 163g de fioul pour 1kwh d''\u00e9lectricit\u00e9
  produit.\\nLe TWIZY fait donc un peut plus que du 1 litre de go au 100 km!\\nElle
  consomme 15kWh pour 1000 Km parcourus. Au prix EDF ca donne 7\u20ac en tarif de
  nuit et 10,5\u20ac en tarif de jour !!!\\nApr\u00e8s 3 mois d''utilisation le constat
  est le suivant; simplement g\u00e9nial, mais trop de gens la prennent pour une voiture
  sans permis limit\u00e9e \u00e0 45 km/h et vous coupent la route. Le constructeur
  a du le pr\u00e9voir car elle a un klaxon de camion. Idem, \u00e9viter de d\u00e9marrer
  \u00e0 fond , beaucoup de proprios de 4X4 on horreur de se faire mettre 50m dans
  la vue par une petite merde !!! Vivement qu''elle ai des copines sur l''\u00eele
  et que les gens s''y habituent. Sinon j''ai une solution pour d\u00e9gager la route,
  mais c''est pas r\u00e9glementaire !\\n-\\nDonc le coffre de 31 litres derri\u00e8re
  le dossier de si\u00e8ge arri\u00e8re et qui ferme \u00e0 cl\u00e9.\\nEt les deux
  bo\u00eetes \u00e0 gant, celle de droite fermant \u00e0 cl\u00e9.\\n-\\nLes mesures
  d''acc\u00e9l\u00e9ration du Twizy 80\\nint\u00e9ressantes jusqu''au 0 \u00e0 40
  km/h, ce\\nqui pour un v\u00e9hicule destin\u00e9 \u00e0 la ville...\\n-\\nUn essai
  par - 5 degr\u00e9s en D\u00e9cembre \u00e0 Strasbourg\\nJ\u2019ai test\u00e9 le
  Renault Twizy en hiver\\n18 D\u00e9c 2012\\nTwizy vraiment utilisable en plein hiver
  ?\\nT80 que j\u2019ai lou\u00e9 chez Renault par une temp\u00e9rature de -5\u00b0\u2026\\nIl
  est 8h du matin, je m\u2019assois tranquillement au volant de ma Nissan LEAF avec
  ses si\u00e8ges chauffants. Je sais que ce confort sera de courte dur\u00e9e : j\u2019ai
  rendez-vous chez Renault qui me met un Twizy \u00e0 disposition deux jours pour
  test en conditions hivernales.\\nLe vendeur m\u2019accompagne vers le Twizy en m\u2019expliquant
  que personne ne demande d\u2019essai du Twizy en ce moment. C\u2019est s\u00fbr
  que la saison ne joue pas en faveur des ventes d\u2019une voiture ouverte et sans
  chauffage ! Toutefois, je suis convaincu que ce test sera utile \u00e0 ceux qui
  veulent s\u2019\u00e9quiper d\u2019un Twizy.\\nJe prends donc la route et je m\u2019ins\u00e8re
  rapidement dans le trafic en retrouvant cette sensation d\u2019agilit\u00e9 que
  j\u2019avais d\u00e9j\u00e0 ressentie lors de mes pr\u00e9c\u00e9dents essais du
  Twizy. Le c\u00f4t\u00e9 \u00ab tape-cul \u00bb du v\u00e9hicule se rappelle aussi
  \u00e0 moi bien rapidement !\\nPour l\u2019instant, je n\u2019ai pas vraiment froid.
  Le pare-brise du Twizy d\u00e9vie correctement le flux d\u2019air sur les c\u00f4t\u00e9s,
  c\u2019est d\u2019ailleurs une assez bonne surprise : je ne ressent pas l\u2019effet
  du vent d\u00fb \u00e0 la vitesse. Le temps est sec, il y a peu de vent mais la
  temp\u00e9rature est de -5\u00b0. Je me suis habill\u00e9 en cons\u00e9quence :
  un bon pull, un long manteau et des gants.\\nPremier changement au volant du Twizy
  : je dois trouver un autre chemin que celui que je prends d\u2019habitude pour aller
  au bureau car je ne peux pas prendre l\u2019autoroute. Et id\u00e9bute ma travers\u00e9e
  de Strasbourg.\\nPrendre le volant du Twizy est toujours un plaisir pour moi. Je
  trouve ce v\u00e9hicule fun et sympa \u00e0 conduire. Il a toujours le m\u00eame
  effet sur les passants et aux autres automobilistes, \u00e9tonn\u00e9s de voir ce
  petit v\u00e9hicule inhabituel ! En tout cas, je m\u2019amuse bien \u00e0 son volant,
  malgr\u00e9 le froid.\\nEn roulant, je m\u2019interroge : est-ce que le Twizy est
  vraiment utilisable par \u00ab monsieur-tout-le-monde \u00bb au quotidien par de
  telles temp\u00e9ratures ?\\nSur les trajets de moins de 20 minutes, c\u2019est
  tout \u00e0 supportable. Au-del\u00e0, je commence \u00e0 ressentir le froid d\u00fb
  \u00e0 mon immobilit\u00e9 dans le v\u00e9hicule.\\nApr\u00e8s 30 minutes de route,
  j\u2019arrive au bureau. J\u2019ai un T peu froid au bout des doigts et je me rends
  compte que les gants sont indispensables pour rouler en Twizy par ce froid. Autrement,
  tout va bien. Ce qui est s\u00fbr, c\u2019est que ce genre de trajet vous r\u00e9veille
  bien pour d\u00e9marrer la journ\u00e9e !\\nLe Twizy est \u00e0 l\u2019ext\u00e9rieur,
  gar\u00e9 sous ma fen\u00eatre o\u00f9 je peux avoir un \u0153il dessus.\\n18h15,
  fini ma journ\u00e9e de travail et le Twizy qui m\u2019attends dehors. Il neige
  un peu et l\u2019endroit o\u00f9 est gar\u00e9 le v\u00e9hicule n\u2019est pas bien
  \u00e9clair\u00e9. Je t\u00e2tonne pour trouver la poign\u00e9e de porte et je m\u2019installe
  au volant. Premi\u00e8re mauvaise surprise : il y avait un peu de neige sur le si\u00e8ge,
  que je n\u2019ai pas vue. Sensation d\u00e9sagr\u00e9able.\\nJe prends la route
  en prenant soin de faire quelques tests d\u2019adh\u00e9rence sur ce qui est maintenant
  un mix entre pluie et neige. Le v\u00e9hicule accroche quand m\u00eame un peu et
  je dois y aller franchement pour le faire glisser : \u00e7a me rassure. L\u2019\u00e9clairage
  de nuit est aussi compl\u00e8tement satisfaisant. Je m\u2019ins\u00e8re dans la
  ville, sans bruit.\\nMon trajet durera 45 minutes ce soir, \u00e0 cause des bouchons.
  Dans ces cas l\u00e0, rouler en Twizy est tout de suite moins agr\u00e9able : je
  n\u2019avance pas et je commence \u00e0 avoir froid. Ironie du sors, je suis derri\u00e8re
  un Scenic diesel qui pue et c\u2019est vraiment d\u00e9sagr\u00e9able. Je n\u2019ai
  qu\u2019une envie, faire de la remont\u00e9e de file comme si j\u2019avais un scooter.
  Mais voil\u00e0, Twizy n\u2019est pas un scooter\u2026 je patiente\u2026 ces instants
  me semblent durer des haeures.\\nLe trafic se fluidifie et j\u2019arrive rapidement
  chez moi. La prochaine \u00e9tape est de mettre le Twizy \u00e0 recharger, m\u00eame
  si j\u2019ai encore 55% de la batterie. Arriv\u00e9 devant mon garage, j\u2019ai
  un gros doute : est-ce que je vais pouvoir ouvrir les portes en \u00e9lytres du
  Twizy dans mon garage o\u00f9 le plafond n\u2019est pas tr\u00e8s haut ? Je fais
  le test : \u00e7a passe, mais \u00e0 condition de ne pas le mettre trop vers l\u2019avant
  du garage, pour ne pas qu\u2019elles touchent la porte d\u2019entr\u00e9e.\\nLa
  recharge se passe sans soucis. Je sors le cable de l\u2019avant du v\u00e9hicule,
  je le branche sur ma prise domestique, le tour est jou\u00e9. C\u2019est \u00e0
  ce moment qu\u2019un des principaux avantages du Twizy me saute aux yeux : dans
  une heure et demi, j\u2019aurais fait le plein. Il faut 3h30 pour le recharger compl\u00e8tement
  depuis 0. Par rapport \u00e0 une autre voiture \u00e9lectrique, c\u2019est \u00e9videmment
  un point fort !\\nJe laisse le Twizy se recharger jusqu\u2019au lendemain et je
  monte me r\u00e9chauffer\u2026\\nCe matin, j\u2019ouvre le garage et je d\u00e9couvre
  le Twizy dans l\u2019\u00e9tat o\u00f9 je l\u2019ai laiss\u00e9 hier. Il a charg\u00e9
  sans soucis cette nuit et la batterie est pleine. Le tableau de bord m\u2019indique
  une autonomie de 50 km. En \u00e9t\u00e9, il semble que l\u2019on soit plus aux
  alentours de 70 km d\u2019autonomie.\\nJe d\u00e9branche le Twizy mais j\u2019\u2019ai
  un peu de mal \u00e0 ranger le c\u00e2ble dans l\u2019espace \u00e9troit qui lui
  est d\u00e9di\u00e9. En for\u00e7ant un peu \u00e7a rentre finalement. Je mets ma
  mallette et mon repas de midi sur le si\u00e8ge arri\u00e8re.\\nAujourd\u2019hui,
  il fait moins froid et \u00e7a n\u2019est pas pour me d\u00e9plaire ! Du coup, faire
  la route en Twizy est sympa, m\u00eame si je peste contre ces pots d\u2019\u00e9chappement
  derri\u00e8re lesquels je suis coll\u00e9. C\u2019est tr\u00e8s d\u00e9sagr\u00e9able.\\nAu
  feu rouge, un passant m\u2019interpelle :\\n\u2013 C\u2019est 100% \u00e9lectrique
  ?\\n\u2013 Oui, tout \u00e0 fait !\\n\u2013 C\u2019est g\u00e9nial, top ! Et on
  peut fermer ?\\n\u2013 Il existe des vitres en option, mais on ne peut pas tout
  \u00e0 fait fermer. Les portes s\u2019ouvrent en \u00e9lytres, donc \u00e7a n\u2019est
  pas possible.\\n\u2013 D\u2019accord, en tout cas c\u2019est super !\\nUne nouvelle
  preuve du capital-sympathie immense que poss\u00e8de le Twizy. Les discussions comme
  celle-ci sont nombreuses ! Ce petit v\u00e9hicule 100% \u00e9lectrique et original
  laisse peu de monde indiff\u00e9rent.\\nLe soir, avec mon \u00e9pouse, nous d\u00e9cidons
  de prendre le Twizy pour nous rendre au march\u00e9 de No\u00ebl de Strasbourg.
  Une bonne occasion pour tester le confort du passager dans ces conditions hivernales.\\nAvec
  sa petite taille (1m60), elle n\u2019a aucun mal \u00e0 prendre place \u00e0 l\u2019arri\u00e8re.
  N\u00e9anmoins, une personne plus corpulente aura plus de mal. Il pleut l\u00e9g\u00e8rement
  lorsque nous partons. Nous constatons que le passager arri\u00e8re est relativement
  prot\u00e9g\u00e9 de la pluie, en tout cas quand il ne pleut pas trop fort.\\nAu
  niveau du froid, il doit faire autour de 5\u00b0, et c\u2019est supportable en tant
  que passager, \u00e0 condition d\u2019\u00eatre bien habill\u00e9. Un bonnet semble
  indispensable et des lunettes sont conseill\u00e9es pour ceux qui sont sensibles
  au niveau des yeux. Elle remarque aussi que l\u2019endroit o\u00f9 elle a le plus
  froid, c\u2019est au niveau des jambes : les portes du Twizy laissent passer un
  flux d\u2019air qui peut \u00eatre d\u00e9sagr\u00e9able.\\nAu march\u00e9 de No\u00ebl,
  le Twizy fait sensation ! Une personne nous interpelle pour en savoir plus sur l\u2019engin
  et s\u2019\u00e9tonne du fait qu\u2019il n\u2019y a pas de vitres. Je lui explique
  alors que m\u00eame les portes sont en option !\\nParlons des portes justement :
  par temps de pluie, elles me semblent indispensables. En effet, apr\u00e8s une quinzaine
  de km sous une pluie fine, elles sont couvertes de projections en provenance des
  roues. Je me dis qu\u2019elles auraient certainement \u00e9t\u00e9 sur nos v\u00eatements
  sans la protection des portes !\\n\u00c0 part \u00e7a, ma pr\u00e9cieuse passag\u00e8re
  se sent bien dans le Twizy. Un peu comme sur une moto tout en se sentant mieux prot\u00e9g\u00e9e.
  La chose qui l\u2019incommodera le plus n\u2019est pas le froid mais les gaz d\u2019\u00e9chappement.
  Dans le Twizy, on rajoute un sens \u00e0 la conduite : celui de l\u2019odorat. Toutes
  les odeurs ext\u00e9rieures, bonnes ou mauvaises, semblent amplifi\u00e9es !\\nConclusion\\nAu
  final, ce test du Twizy en hiver me laisse perplexe. Si il est bien possible de
  l\u2019utiliser par des temp\u00e9ratures basses, j\u2019ai du mal \u00e0 cerner
  les avantages pour l\u2019utilisateur dans le trafic urbain. On a moins de confort
  qu\u2019une voiture classique, et les seuls avantages objectifs que j\u2019ai trouv\u00e9
  au Twizy sont la facilit\u00e9 \u00e0 se garer et son temps de charge r\u00e9duit
  par rapport \u00e0 une autre voiture \u00e9lectrique.\\nPour l\u2019\u00e9t\u00e9,
  ce v\u00e9hicule est tr\u00e8s fun, voire attachant. Par contre, l\u2019hiver en
  d\u00e9couragera certainement plus d\u2019un\u2026 D\u00e8s lors, je me demande
  si Renault ne devrait pas r\u00e9fl\u00e9chir \u00e0 une possibilit\u00e9 de mettre
  en pause la location de batteries pour les mois d\u2019hiver.\\nSi vous envisagez
  l\u2019achat d\u2019un Twizy, je vous conseille de le louer en hiver et de vous
  forger votre propre opinion : vous le testerez dans le pire des cas et vous ne pourrez
  qu\u2019avoir des bonnes surprises en \u00e9t\u00e9 !\\nRemerciements : Merci \u00e0
  la concession Renault de Strasbourg-Illkirch pour la mise \u00e0 disposition du
