  \u00e0 la bouillie bordelaise \u00e0 la chute des feuilles\\nSorry, the comment
  form is closed at this time.\"", "\"\u00c0 Rochefort : 3e Festival du cin\u00e9ma
  des pays du Pacifique sud du vendredi 29 mai au lundi 1er juin 2009\\nTr\u00e8s
  loin des clich\u00e9s exotiques souvent associ\u00e9s aux \\\"\u00eeles paradisiaques\\\",
  le regard des r\u00e9alisateurs ainsi que l''expertise des intervenants invit\u00e9s
  aux d\u00e9bats permettent de mieux comprendre \u00e0 la fois l''histoire et la
  r\u00e9alit\u00e9 quotidienne des peuples de \\\"l''aire oc\u00e9anienne\\\". L''association
  \\\"Cin\u00e9ma d''ailleurs\\\" porte cet \u00e9v\u00e9nement qui fait le lien entre
  le pass\u00e9 maritime de la cit\u00e9 rochefortaise, les grandes exp\u00e9ditions
  scientifiques du 18e si\u00e8cle et ses relations avec les pays du Pacifique Sud.\\nAvec
  pour cette 3e \u00e9dition 16 films documentaires et de fiction, la programmation
  du festival r\u00e9unit des cin\u00e9astes confirm\u00e9s ainsi que les films de
