  en Oc\u00e9anie qui se tient \u00e0 Papeete ainsi qu''avec le festival du Cin\u00e9ma
  des Antipodes de Saint-Tropez.\\nL''\u00e9dition 2009 rendra deux hommages aux \\\"hommes
