  Projection sur invitation \u00e0 retirer \u00e0 l''accueil du festival, dans la
  limite des places disponibles.\\n\u00c0 16h : denier d\u00e9bat avec le r\u00e9alisateur
  Charles Belmont et cl\u00f4ture du festival.\"", "\"Recettes rapides : Nos dossiers\\n10
  desserts sans cuisson et tellement, mais tellement bons\\nTu dois faire un dessert
  mais voil\u00e0, ton four est d\u00e9j\u00e0 occup\u00e9 par le gratin de courgettes
