  - 3 ans et au-dessus - Femelles - Gazon - Corde \u00e0 droite\"", "\"Le 21 juillet,
  la FRA a pr\u00e9sent\u00e9 l''agence et son rapport annuel 2014 sur les d\u00e9fis
  et les r\u00e9alisations en mati\u00e8re de droits fondamentaux au S\u00e9nat polonais
  \u00e0 Varsovie. S''exprimant lors de la session conjointe de trois commissions
  parlementaires - la commission des affaires europ\u00e9ennes, la commission des
  affaires familiales, de la politique sociale et des seniors et la commission des
  droits de l''homme, de l''\u00c9tat de droit et des p\u00e9titions -, le directeur
  par int\u00e9rim de la FRA, Constantinos Manolopoulos, s''est concentr\u00e9 sur
  les questions li\u00e9es aux migrations, aux droits des victimes et aux droits de
  l''enfant.\"", "\"Editeur : Nats \u00e9ditions\\nLivre : ICI\\nLa maman d\u2019Ana\u00e9
  est une maman\u2026 magique ! En effet, au lieu de marcher comme tout le monde,
  elle ne se d\u00e9place que sur ses quatre roues. En plus, elle est toujours accompagn\u00e9e
  de Black, un chien super-h\u00e9ros\u2026 Venez vite, Ana\u00e9 va vous raconter
  son histoire\u2026\\nPour La magie de Maman, Marguerite Soupel s\u2019inspire de
  sa propre histoire pour d\u00e9crire le quotidien de maman en fauteuil, soutenue
  par les illustrations de St\u00e9phanie Delvoye.\\n\u2b50 \u2b50 \u2b50 \u2b50 \u2b50\\nLe
  probl\u00e8me avec ce livre, c\u2019est que tout les enfants vont vouloir d\u2019une
  maman magique comme la petite Ana\u00e9 ! Apr\u00e8s tout, quel enfant ne r\u00eaverait
  pas que sa maman soit magique, qu\u2019elle soit une f\u00e9e avec un chien super-h\u00e9ros
  ?\\nEn dehors de l\u2019histoire en elle-m\u00eame qui montre aux enfants que ce
  n\u2019est pas forc\u00e9ment toujours facile lorsque l\u2019on est en fauteuil
  roulant, surtout lorsqu\u2019il y a des escaliers ou des marches un peu trop hautes,
  j\u2019ai aim\u00e9 le fait que l\u2019on y parle \u00e9galement des chiens d\u2019assistance,
  que ce soit expliqu\u00e9 aux enfants. Mais le petit plus en plus, que tout les
  enfants vont forc\u00e9ment adorer, c\u2019est qu\u2019il y a des petits jeux en
  fin de livre, dont un coloriage et le jeu des erreurs entre deux images, cela fait
  toujours plaisir aux enfants ce genre de petites attentions.\\nN\u2019oublions pas
  de mentionner les superbes illustrations, \u00e0 elles seules elles nous racontent
  l\u2019histoire d\u2019Ana\u00e9 et de sa maman magique, elles sont tout simplement
  magnifiques.\\nAvec ce petit livre, les enfants verront forc\u00e9ment les personnes
  en fauteuils roulant d\u2019une autre mani\u00e8re que comme des gens bizarres,
  peut-\u00eatre que cela les rendra plus tol\u00e9rants \u00e9galement que beaucoup
  d\u2019adultes sans compassion. Un livre \u00e0 offrir aux plus jeunes sans h\u00e9siter.\\nMerci
  \u00e0 Merry et aux \u00e9ditions Nats pour leur confiance.\"", "\"ANNIVERSAIRE
  DES 30 ANS\\nDE LA D\u00c9CLARATION DES DROITS DE L\u2019ENFANT\\nMERCREDI 20 NOVEMBRE
  \u2013 20H30\\nEN PARTENARIAT AVEC L\u2019UNICEF\\nET LA FONDATION SEVE (Savoir
  \u00eatre et vivre ensemble)\\nLE CERCLE DES PETITS PHILOSOPHES\\nde C\u00e9cile
  Denjean\\nDocu Fr. 2018 \u2013 1h30. Avec Fr\u00e9d\u00e9ric Lenoir\\nQuel est le
  sens de la vie ? de la mort ? Ces questions, le philosophe Fr\u00e9d\u00e9ric Lenoir
  les a pos\u00e9es \u00e0 des enfants de 7 \u00e0 10 ans au cours d\u2019ateliers
  philosophiques, et s\u2019\u00e9merveille toujours de la capacit\u00e9 des enfants
  \u00e0 d\u00e9battre !\\nUne lecture de la D\u00e9claration des droits de l\u2019enfant
  sera faite avant le film par des jeunes ambassadeurs de l\u2019UNICEF. Film suivi
  d\u2019un cin\u00e9-d\u00e9bat en pr\u00e9sence d\u2019Emmanuel Blaizot, repr\u00e9sentant
  PACA de SEVE, et de Marie Saeki, animatrice d\u2019ateliers philosophiques \u00e0
  La Ciotat et Cassis.\\nTARIF UNIQUE 6 \u20ac (DONT 1\u20ac REVERS\u00c9 \u00c0 L\u2019UNICEF)\\nLa
  Fondation SEVE\\nL\u2019\u00e9crivain et philosophe Fr\u00e9d\u00e9ric Lenoir a
  cocr\u00e9\u00e9 la Fondation SEVE (Savoir \u00catre et Vivre Ensemble) en 2016
  avec Martine Roussel-Adam. Cette fondation d\u00e9veloppe en France et \u00e0 l\u2019International
  des Ateliers de Philosophie aupr\u00e8s des enfants,\\nen \u00e9tablissements scolaires,
  collectivit\u00e9s locales, associations\u2026 Son objectif : d\u00e9velopper la
  pens\u00e9e r\u00e9flexive et critique des enfants et des adolescents, afin qu\u2019ils
  grandissent en discernement et en humanit\u00e9, et deviennent des citoyens conscients,
  actifs et \u00e9clair\u00e9s. Plusieurs \u00e9coles de La Ciotat et de la r\u00e9gion
  ont d\u00e9j\u00e0 accueilli ces ateliers philosophiques, notamment en \u00e9cole
  primaire.\"", "\"L''\u00e9limination de l''h\u00e9patite C en tant que menace pour
  la sant\u00e9 publique d''ici 2030 est au c\u0153ur de la mission de CanHepC et
  de notre programme de recherche. Nous travaillons \u00e9galement avec nos partenaires
  nationaux et r\u00e9gionaux pour ancrer notre strat\u00e9gie d''application et d''\u00e9change
  des connaissances autour du mod\u00e8le directeur d''\u00e9limination de l''h\u00e9patite
  C et du projet de feuille de route.\\nRecherche pour guider l''\u00e9limination
  de l''h\u00e9patite C\\nL''objectif de CanHepC est d''am\u00e9liorer la sant\u00e9
  des personnes vivant avec l''h\u00e9patite C \u00e0 toutes les \u00e9tapes de la
  cascade de soins, en comblant l''\u00e9cart entre les connaissances et les pratiques
  tout en formant et en renfor\u00e7ant les capacit\u00e9s en recherche.\\nUne partie
  importante de notre mission est de contribuer \u00e0 l''effort global men\u00e9
  par l''Organisation mondiale de la sant\u00e9 pour \u00e9liminer l''h\u00e9patite
  virale en tant que menace pour la sant\u00e9 publique en fournissant les donn\u00e9es
  probantes pour guider le programme d''\u00e9limination de l''h\u00e9patite C au
  Canada et de par le monde. Notre programme de recherche est ax\u00e9 sur la mesure
  et l''optimisation des strat\u00e9gies sp\u00e9cifiques aux populations touch\u00e9es
  en termes de pr\u00e9vention, de d\u00e9pistage et de diagnostic, et des soins et
  traitements n\u00e9cessaires pour atteindre l''\u00e9limination de l''h\u00e9patite
  C. Notre recherche vise \u00e9galement \u00e0 surveiller et \u00e0 suivre les progr\u00e8s
  vers les objectifs d''\u00e9limination de l''h\u00e9patite C.\\nCadre politique
  national : le Mod\u00e8le directeur\\nEn 2019, CanHepC et plusieurs partenaires
  nationaux ont publi\u00e9 le Mod\u00e8le directeur pour guider les efforts d''\u00e9limination
  de l''h\u00e9patite C au Canada (Mod\u00e8le directeur), un cadre strat\u00e9gique
  national qui vise \u00e0 compl\u00e9ter le plan d''action quinquennal du gouvernement
  canadien sur les infections transmissibles sexuellement et par le sang.\\nLe Mod\u00e8le
  directeur inclut des objectifs align\u00e9s sur ceux de l''Organisation mondiale
  de la sant\u00e9 avec des cibles mesurables dans le temps en mati\u00e8re de pr\u00e9vention,
  de d\u00e9pistage et de diagnostic, de soins et de traitement, ainsi que des recommandations
  ax\u00e9es sur les populations prioritaires. Le Mod\u00e8le directeur a \u00e9t\u00e9
  \u00e9labor\u00e9 au moyen d''un processus consultatif et inclusif, s''appuyant
  sur l''expertise et les donn\u00e9es probantes du r\u00e9seau CanHepC et au-del\u00e0,
  y compris l''engagement avec des chercheurs, des organisations communautaires, des
  personnes ayant une exp\u00e9rience v\u00e9cue et les populations touch\u00e9es,
  des cliniciens, des travailleurs de la sant\u00e9 et autres.\\nAvancement r\u00e9gional
  : projet de feuille de route\\nEn 2020-2021, CanHepC a lanc\u00e9 le projet de feuille
  de route pour l''\u00e9limination de l''h\u00e9patite C afin de continuer \u00e0
  soutenir les efforts d''\u00e9limination de l''h\u00e9patite C depuis la publication
  du Mod\u00e8le directeur. Ce projet vise \u00e0 \u00e9laborer des feuilles de route
  r\u00e9gionales pour l''\u00e9limination de l''h\u00e9patite C en plus d''une feuille
  de route nationale autochtones pour l''\u00e9limination de l''h\u00e9patite C chez
  les peuples autochtones (Premi\u00e8res Nations, les M\u00e9tis et les Inuits).\\nLes
  objectifs des feuilles de route sont de contextualiser et d''adapter les recommandations
  du Mod\u00e8le directeur \u00e0 des r\u00e9gions sp\u00e9cifiques du Canada, de
  faciliter un processus de consultation multipartite pour guider les recommandations
  et les actions pour mettre en \u0153uvre des plans d''\u00e9limination de l''h\u00e9patite
  C au niveau provincial/r\u00e9gional, et d''\u00e9valuer les progr\u00e8s vers l''\u00e9limination.\"",
  "\"Entreprise de ravalement de fa\u00e7ade Ouezy\\nAvant de pouvoir commencer les
  travaux de votre ravalement, il faut remplir une D\u00e9claration Pr\u00e9alable
